import styled from 'styled-components'
import cat404 from './img/404.webp'

const NotFound = () => {
  return (
    <img src={cat404} alt='not found' />
  )
}

const Container = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`

export default NotFound
